import React from "react";

class Footer extends React.Component {
  render() {
    return (
      <div className="footer">
        <center>
          <p>
            Designed and built by Blue Mesa Engineering using HTML, CSS, and
            ReactJS. 2019.
          </p>
        </center>
      </div>
    );
  }
}

export default Footer;
